    def name(self):
        return self.Name

    @property
    def Parent(self):
        return self.accessobject.Parent

    # Lower case aliases for Parent
    @property
    def parent(self):
        return self.Parent

    @property
    def Properties(self):
        return AccessObjectProperties(self.accessobject.Properties)

    # Lower case aliases for Properties
    @property
    def properties(self):
        return self.Properties

    @property
    def Type(self):
        return AcObjectType(self.accessobject.Type)

    # Lower case aliases for Type
