class AccessObjectProperties:

    def __init__(self, accessobjectproperties=None):
        self.accessobjectproperties = accessobjectproperties

    @property
    def Application(self):
        return self.accessobjectproperties.Application

    @property
    def Count(self):
        return self.accessobjectproperties.Count

    # Lower case aliases for Count
    @property
    def count(self):
        return self.Count

    def Item(self, Index=None):
        arguments = com_arguments([Index])
        if callable(self.accessobjectproperties.Item):
            return self.accessobjectproperties.Item(*arguments)
        else:
            return self.accessobjectproperties.GetItem(*arguments)

    # Lower case aliases for Item
    def item(self, Index=None):
        arguments = [Index]
        return self.Item(*arguments)

    @property
    def Parent(self):
        return self.accessobjectproperties.Parent

    # Lower case aliases for Parent
    @property
    def parent(self):
        return self.Parent

    def Add(self, PropertyName=None, Value=None):
        arguments = com_arguments([PropertyName, Value])
        self.accessobjectproperties.Add(*arguments)

    # Lower case alias for Add
    def add(self, PropertyName=None, Value=None):
        arguments = [PropertyName, Value]
        return self.Add(*arguments)

    def Remove(self, Item=None):
        arguments = com_arguments([Item])
        self.accessobjectproperties.Remove(*arguments)

    # Lower case alias for Remove
    def remove(self, Item=None):
        arguments = [Item]
        return self.Remove(*arguments)


